import React, { useState } from "react";
import { NavLink, Outlet, useNavigate } from "react-router-dom";
import { useEffect } from "react";

import "./AdminDashboard.css"

const AdminDashboard = () => {
  const [open, setOpen] = useState(false);
  const navigate = useNavigate();
  const [adminName, setAdminName] = useState("");

  useEffect(() => {
    const storedName = localStorage.getItem("adminName");
    if (storedName) setAdminName(storedName);
  }, []);

  return (
    <div className="admin-dashboard">
      <header>
        <h1>Welcome</h1>
      </header>

      {/* Hamburger Icon */}
      <div className="hamburger" onClick={() => setOpen(!open)}>
        <div></div>
        <div></div>
        <div></div>
      </div>

      {/* Header */}
      <header className="admin-header">
        <h2>Admin Dashboard</h2>
      </header>

      {/* Sidebar */}
      <nav className={`sidebar ${open ? "open" : ""}`}>
        <ul>
          <li><NavLink to="all-users">All Users</NavLink></li>
          <li><NavLink to="pending">Pending Approvals</NavLink></li>
          <li><NavLink to="approved">Approved Feedbacks</NavLink></li>
        { /* <li><NavLink to="rejected">Rejected Feedbacks</NavLink></li> */}
          <li><button onClick={() => navigate("/AdminLogin")}>Logout</button></li>
        </ul>
      </nav>

      {/* Main Content */}
      <div className="main-content">
        <Outlet />
      </div>

    </div>
  );
};

export default AdminDashboard;
